import React from 'react';

import Img1 from  '../assets/nature.jpg';
import Img2 from  '../assets/sunset.jpg';

class Natureimage extends React.Component {

render()  {
    return(
        <div>
            <center>
            <img src={Img1} alt="Img1"  width='300' height='250'/>&nbsp;&nbsp;&nbsp;
            <img src={Img2} alt="Img2" width='400' heigth='500'/>
            </center>
        </div>                          
    );
}
}
export default Natureimage;
